// 统一管理项目接口的模块
// 引入二次封装axios
import request from "./request";
import mockRequests from "./mockAjax";
import { get } from "core-js/core/dict"; //API接口统一管理，发送请求（TypeNav）

export var reqCategoryList = function reqCategoryList() {
  return request({
    url: '/product/getBaseCategoryList',
    method: 'get'
  });
}; // 获取banner(Home首页轮播图接口)

export var reqGetBannerList = function reqGetBannerList() {
  return mockRequests({
    url: '/banner',
    method: 'get'
  });
}; // 获取floor的模拟接口数据

export var reqGetFloorList = function reqGetFloorList() {
  return mockRequests({
    url: '/floor',
    method: 'get'
  });
}; // 获取search搜索模块数据 地址是:/api/list 请求方式:post
// 当前的这个接口给服务器传递的参数params---他至少是一个空对象

export var reqGetSearchInfo = function reqGetSearchInfo(params) {
  return request({
    url: '/list',
    method: 'post',
    data: params
  });
}; //获取产品详情信息的接口 地址是/api/item/{ skuId } 请求方式:get

export var reqGoodsInfo = function reqGoodsInfo(skuId) {
  return request({
    url: "/item/".concat(skuId),
    method: 'get'
  });
}; // 将产品添加到购物车中（获取更新某一产品的个数） 地址是/api/cart/addToCart/{ skuId }/{ skuNum } 请求方式：post

export var reqAddOrUpdateShopCart = function reqAddOrUpdateShopCart(skuId, skuNum) {
  return request({
    url: "/cart/addToCart/".concat(skuId, "/").concat(skuNum),
    method: 'post'
  });
}; // 获取购物车列表数据接口 地址是：/api/cart/cartList 请求方式:get

export var reqCartList = function reqCartList() {
  return request({
    url: '/cart/cartList',
    method: 'get'
  });
}; // 删除购物车产品的接口 地址是:/api/cart/deleteCart/{skuId} 请求方式:DELETE

export var reqDeleteCartById = function reqDeleteCartById(skuId) {
  return request({
    url: "/cart/deleteCart/".concat(skuId),
    method: 'DELETE'
  });
}; // 切换商品选中状态 地址是：/api/cart/checkCart/{skuID}/{isChecked} 请求方式是：get

export var reqUpdateCheckedById = function reqUpdateCheckedById(skuId, isChecked) {
  return request({
    url: "/cart/checkCart/".concat(skuId, "/").concat(isChecked),
    method: 'get'
  });
}; //获取验证码 地址是/api/user/passport/sendCode/{phone} 请求方式:get

export var reqGetCode = function reqGetCode(phone) {
  return request({
    url: "/user/passport/sendCode/".concat(phone),
    method: 'get'
  });
}; //注册 地址是：/api/user/passport/register 请求方式是post  phone code password

export var reqUserRegister = function reqUserRegister(data) {
  return request({
    url: '/user/passport/register',
    data: data,
    method: 'post'
  });
}; //登录 地址是/api/user/passport/login 请求方式post   phone password

